export interface IDecorationElement extends IElementBase{
 	/**序号
10000背部挂件
20000肩部挂件
30000拖尾
40000特效挂件
50000头衔*/
	id:number
	/**名称策划看*/
	content:string
	/**装扮名称*/
	name:string
	/**装扮类型
1：背部
2：肩部
3：拖尾
4：特效
5：头衔*/
	type:number
	/**挂件的Guid
（prefab或资源库）*/
	guid:string
	/**是否是prefab
（0否，1是）*/
	isPrefab:number
	/**装扮文本描述*/
	detail:string
	/**装扮文本描述策划看*/
	detailContent:string
	/**挂件稀有度
0：神话（金）
1：传说（橙）
2：史诗（紫）
3：稀有（蓝）
4：普通（灰）*/
	rarity:number
	/**挂件偏移*/
	pos:mw.Vector
	/**挂件旋转*/
	rot:mw.Vector
	/**挂件缩放
（世界缩放）*/
	scale:mw.Vector
	/**icon图标的资源库guid*/
	icon:string
	/**头衔类装扮的文本*/
	title:string
	/**头衔类装扮文本策划看*/
	titleContent:string
	/**头衔类别
0：前置于玩家id
1：后置于玩家id*/
	titleType:number
	/**头衔颜色
（颜色码）*/
	titleColor:string
	/**是否为默认解锁
0：是
1：否*/
	giftType:number
	/**稀有度ui在global表里的key*/
	rarityGlobal:number
	/**时尚分数*/
	itemScores:number
 } 
